    "contracts/LuminaiAirdrop.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract LuminaiAirdrop is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 public luminai;

    uint256 public constant MAX_AIRDROP_COUNT = 5;
    uint256 public constant MAX_COUNT_TIME = 1 days;

    mapping(address => mapping(uint256 => uint256)) public airdropAmount;
    mapping(address => uint256) public airdropClaimedAmount;

    uint256 public AIRDROP_CLAIM_FEE = 1 ether;
    uint256 public AIRDROP_TOKEN_AMOUNT = 20 ether;

    uint256 public REFERRAL_PERCENT = 5;
    uint256 public TOTAL_PERCENT = 100;
    uint256 public totalReferralAmount;
    uint256 public totalAirdropClaimed;
    uint256 public totalAirdropCount;

    // add events for all important actions
    event AirdropClaimed(
        address indexed user,
        uint256 indexed amount,
        address indexed referral
    );

    event TokenWithdrawn(address indexed user, uint256 indexed amount);

    event MaticWithdrawn(address indexed user, uint256 indexed amount);

    event TokenDeposited(address indexed user, uint256 indexed amount);

    constructor(address _luminai) {
        require(
            _luminai != address(0),
            "LuminaiAirdrop: luminai address is zero"
        );
        luminai = IERC20(_luminai);
    }

    function setLuminai(address _luminai) public onlyOwner {
        require(
            _luminai != address(0),
            "LuminaiAirdrop: luminai address is zero"
        );
        luminai = IERC20(_luminai);
    }

    function setClaimFee(uint256 _fee) public onlyOwner {
        AIRDROP_CLAIM_FEE = _fee;
    }

    function setTokenAmount(uint256 _amount) public onlyOwner {
        AIRDROP_TOKEN_AMOUNT = _amount;
    }

    function getTokenBalance() public view returns (uint256) {
        return luminai.balanceOf(address(this));
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function claimAirdrop(address _referral) public payable {
        require(
            msg.value == AIRDROP_CLAIM_FEE,
            "LuminaiAirdrop: claim fee is not correct"
        );
        require(
            airdropAmount[msg.sender][block.timestamp / MAX_COUNT_TIME] <
                MAX_AIRDROP_COUNT,
            "LuminaiAirdrop: airdrop count is max"
        );
        require(
            getTokenBalance() >= AIRDROP_TOKEN_AMOUNT,
            "LuminaiAirdrop: token balance is not enough"
        );

        if (_referral != address(0)) {
            uint256 _referralAmount = AIRDROP_TOKEN_AMOUNT
                .mul(REFERRAL_PERCENT)
                .div(TOTAL_PERCENT);
            totalReferralAmount = totalReferralAmount.add(_referralAmount);
            luminai.safeTransfer(_referral, _referralAmount);
        }

        totalAirdropClaimed = totalAirdropClaimed.add(AIRDROP_TOKEN_AMOUNT);
        totalAirdropCount = totalAirdropCount.add(1);

        airdropAmount[msg.sender][block.timestamp / MAX_COUNT_TIME] += 1;
        airdropClaimedAmount[msg.sender] += AIRDROP_TOKEN_AMOUNT;

        emit AirdropClaimed(msg.sender, AIRDROP_TOKEN_AMOUNT, _referral);

        luminai.safeTransfer(msg.sender, AIRDROP_TOKEN_AMOUNT);
    }

    function withdrawToken(address _to, uint256 _amount) public onlyOwner {
        require(_to != address(0), "LuminaiAirdrop: withdraw address is zero");
        require(_amount > 0, "LuminaiAirdrop: withdraw amount is zero");
        require(
            getTokenBalance() >= _amount,
            "LuminaiAirdrop: token balance is not enough"
        );

        emit TokenWithdrawn(_to, _amount);

        luminai.safeTransfer(_to, _amount);
    }

    function withdrawMatic(
        address payable _to,
        uint256 _amount
    ) public onlyOwner {
        require(_to != address(0), "LuminaiAirdrop: withdraw address is zero");
        require(_amount > 0, "LuminaiAirdrop: withdraw amount is zero");
        require(
            getBalance() >= _amount,
            "LuminaiAirdrop: matic balance is not enough"
        );

        emit MaticWithdrawn(_to, _amount);

        _to.transfer(_amount);
    }

    function depositToken(uint256 _amount) public onlyOwner {
        require(_amount > 0, "LuminaiAirdrop: deposit amount is zero");

        emit TokenDeposited(msg.sender, _amount);

        luminai.safeTransferFrom(msg.sender, address(this), _amount);
    }

    receive() external payable {}

    fallback() external payable {}
}
"
    },
    "contracts/LuminaiStakingV2.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./LuminaiAirdrop.sol";
import "hardhat/console.sol";

contract LuminaiStakingV2 is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    address payable public luminaiAirdrop;

    uint256 public PERCENTAGE_DIVIDER = 10000; // 1000 = 100%

    struct Package {
        uint256 min;
        uint256 max;
        uint256 apy;
        uint256 numberOfDays;
    }

    struct PackageInvestment {
        address investor;
        uint256 packageIndex;
        uint256 amount;
        uint256 maxReward;
        uint256 lastInvestmentDate;
        uint256 lastCalculationDate;
        uint256 claimed;
        uint256 pendingReward;
    }

    mapping(address => mapping(uint256 => PackageInvestment))
        public packageInvestments;

    struct Investor {
        address user;
        uint256 totalStaked;
        uint256 totalClaimed;
        uint256 startDate;
        uint256 referralCount;
        uint256 totalReferral;
        address referrer;
    }

    // three level of referral with 5% 2% 1%
    uint256[] public referralRewards = [500, 200, 100];

    uint256 public stakingFee = 2 ether; // 2 MATIC
    uint256 public withdrawFee = 400; // 4%
    uint256 public swapFee = 400; // 4%
    uint256 public lumTokenRate = 15000; // 1 LUM = 0.015 USDT

    uint256 public totalInvestors;
    uint256 public totalStaked;
    uint256 public totalClaimed;
    uint256 public totalReferral;

    uint256 public minimumWithdraw = 1000;

    // staking mapping
    mapping(address => Investor) public investors;

    // usdtToken address
    IERC20 public usdtToken;

    IERC20 public luminaiToken;

    address public feeReceiver;

    // packages
    Package[] public packages;

    // deposit event
    event Deposit(address indexed user, uint256 amount, uint256 package);

    // withdraw event
    event Withdraw(address indexed user, uint256 amount);

    event Restake(address indexed user, uint256 amount);

    event Swap(address indexed user, uint256 amount, uint256 usdtAmount);

    modifier beforeStaking() {
        require(
            LuminaiAirdrop(luminaiAirdrop).totalAirdropClaimed() > 0,
            "LuminaiStakingV2: airdrop not claimed"
        );
        _;
    }

    constructor(
        address _usdtToken,
        address _luminaiToken,
        address _feeReceiver,
        address _luminaiAirdrop
    ) {
        packages.push(Package(1000 ether, 75000 ether, 200, 15 days));
        packages.push(Package((75000 ether) + 1, 500000 ether, 300, 30 days));
        packages.push(Package((500000 ether) + 1, 0, 500, 45 days));

        usdtToken = IERC20(_usdtToken);

        luminaiToken = IERC20(_luminaiToken);

        feeReceiver = _feeReceiver;

        luminaiAirdrop = payable(_luminaiAirdrop);
    }

    function setUsdtAddress(address _usdtToken) external onlyOwner {
        require(_usdtToken != address(0), "Invalid address");
        usdtToken = IERC20(_usdtToken);
    }

    function setLuminaiAddress(address _luminaiToken) external onlyOwner {
        require(_luminaiToken != address(0), "Invalid address");
        luminaiToken = IERC20(_luminaiToken);
    }

    function setLuminaiAirdrop(address _luminaiAirdrop) external onlyOwner {
        require(_luminaiAirdrop != address(0), "Invalid address");
        luminaiAirdrop = payable(_luminaiAirdrop);
    }

    function setStakeFee(uint256 _stakingFee) external onlyOwner {
        require(_stakingFee != stakingFee, "Invalid fee amount");
        stakingFee = _stakingFee;
    }

    function setWithdrawFee(uint256 _withdrawFee) external onlyOwner {
        require(_withdrawFee != withdrawFee, "Invalid fee amount");
        withdrawFee = _withdrawFee;
    }

    function setSwapFee(uint256 _swapFee) external onlyOwner {
        require(_swapFee != swapFee, "Invalid fee amount");
        swapFee = _swapFee;
    }

    function setMinimumWithdraw(uint256 _minimumWithdraw) external onlyOwner {
        require(_minimumWithdraw != minimumWithdraw, "Invalid amount");
        minimumWithdraw = _minimumWithdraw;
    }

    function setFeeAddress(address _feeReceiver) external onlyOwner {
        require(_feeReceiver != address(0), "Invalid address");
        feeReceiver = _feeReceiver;
    }

    function setReferralReward(
        uint256[] memory _referralRewards
    ) external onlyOwner {
        require(_referralRewards.length == 3, "Invalid array length");
        referralRewards = _referralRewards;
    }

    function setLuminaiTokenRate(uint256 _lumTokenRate) external onlyOwner {
        require(_lumTokenRate != lumTokenRate, "Invalid rate amount");
        lumTokenRate = _lumTokenRate;
    }

    function addPackage(
        uint256 _min,
        uint256 _max,
        uint256 _apy,
        uint256 _numberOfDays
    ) external onlyOwner {
        packages.push(Package(_min, _max, _apy, _numberOfDays));
    }

    function setPackage(
        uint256 _index,
        uint256 _min,
        uint256 _max,
        uint256 _apy,
        uint256 _numberOfDays
    ) external onlyOwner {
        packages[_index] = Package(_min, _max, _apy, _numberOfDays);
    }

    function getPackageForAmount(
        uint256 _amount
    ) public view returns (uint256) {
        for (uint256 i = 0; i < packages.length; i++) {
            if (
                _amount >= packages[i].min &&
                (_amount <= packages[i].max || packages[i].max == 0)
            ) {
                return i;
            }
        }
        revert("Invalid amount");
    }

    function calculateCurrentReward(
        address _investor,
        uint256 _packageIndex
    ) public view returns (uint256 totalReward) {
        // if claimed reward is equal to max reward then return 0
        if (
            packageInvestments[_investor][_packageIndex].claimed >=
            packageInvestments[_investor][_packageIndex].maxReward
        ) {
            return 0;
        }

        uint256 daysSinceLastCalculation = block
            .timestamp
            .sub(
                packageInvestments[_investor][_packageIndex].lastCalculationDate
            )
            .div(1 days);

        uint256 pendingReward = packageInvestments[_investor][_packageIndex]
            .amount
            .mul(packages[_packageIndex].apy)
            .div(PERCENTAGE_DIVIDER)
            .mul(daysSinceLastCalculation);

        if (
            totalReward.add(pendingReward).add(
                packageInvestments[_investor][_packageIndex].pendingReward
            ) > packageInvestments[_investor][_packageIndex].maxReward
        ) {
            pendingReward = packageInvestments[_investor][_packageIndex]
                .maxReward
                .sub(
                    totalReward.add(
                        packageInvestments[_investor][_packageIndex]
                            .pendingReward
                    )
                );
        }

        totalReward = totalReward.add(pendingReward).add(
            packageInvestments[_investor][_packageIndex].pendingReward
        );
    }

    function calculateTotalReward(
        address _investor
    ) public view returns (uint256 totalReward) {
        for (uint256 i = 0; i < packages.length; i++) {
            totalReward = totalReward.add(calculateCurrentReward(_investor, i));
        }
    }

    function stakeAmount(
        uint256 _amount,
        address _referralAddress
    ) external payable beforeStaking {
        require(msg.value == stakingFee, "Invalid fee amount");
        uint256 package = getPackageForAmount(_amount);
        luminaiToken.safeTransferFrom(msg.sender, address(this), _amount);

        if (investors[msg.sender].user == address(0)) {
            investors[msg.sender].user = msg.sender;
            investors[msg.sender].startDate = block.timestamp;
            totalInvestors = totalInvestors.add(1);

            if (
                _referralAddress != address(0) &&
                _referralAddress != msg.sender &&
                investors[_referralAddress].user != address(0)
            ) {
                investors[msg.sender].referrer = _referralAddress;
            }
        }

        // referral
        address currentReferralAddress = investors[msg.sender].referrer;
        for (uint256 i = 0; i < referralRewards.length; i++) {
            if (investors[currentReferralAddress].user != address(0)) {
                uint256 reward = _amount.mul(referralRewards[i]).div(
                    PERCENTAGE_DIVIDER
                );
                luminaiToken.safeTransfer(currentReferralAddress, reward);

                totalReferral = totalReferral.add(reward);
                investors[currentReferralAddress].totalReferral = investors[
                    currentReferralAddress
                ].totalReferral.add(reward);
                investors[currentReferralAddress].referralCount = investors[
                    currentReferralAddress
                ].referralCount.add(1);
            }
            currentReferralAddress = investors[currentReferralAddress].referrer;
            if (currentReferralAddress == address(0)) {
                break;
            }
        }

        investors[msg.sender].totalStaked = investors[msg.sender]
            .totalStaked
            .add(_amount);

        if (packageInvestments[msg.sender][package].investor == address(0)) {
            packageInvestments[msg.sender][package].investor = msg.sender;
            packageInvestments[msg.sender][package].packageIndex = package;
            packageInvestments[msg.sender][package].lastCalculationDate = block
                .timestamp;
        } else {
            packageInvestments[msg.sender][package]
                .pendingReward = calculateCurrentReward(msg.sender, package);

            packageInvestments[msg.sender][package].lastCalculationDate = block
                .timestamp;
        }

        packageInvestments[msg.sender][package].lastInvestmentDate = block
            .timestamp;
        packageInvestments[msg.sender][package].amount = packageInvestments[
            msg.sender
        ][package].amount.add(_amount);

        totalStaked = totalStaked.add(_amount);

        uint256 _maxReward = _amount
            .mul(packages[package].apy)
            .div(PERCENTAGE_DIVIDER)
            .mul(packages[package].numberOfDays.div(1 days));

        packageInvestments[msg.sender][package].maxReward = packageInvestments[
            msg.sender
        ][package].maxReward.add(_maxReward);

        emit Deposit(msg.sender, _amount, package);
    }

    function restakeAmount(uint256 _amount, address _referralAddress) internal {
        uint256 package = getPackageForAmount(_amount);

        if (investors[msg.sender].user == address(0)) {
            investors[msg.sender].user = msg.sender;
            investors[msg.sender].startDate = block.timestamp;
            totalInvestors = totalInvestors.add(1);

            if (
                _referralAddress != address(0) &&
                _referralAddress != msg.sender &&
                investors[_referralAddress].user != address(0)
            ) {
                investors[msg.sender].referrer = _referralAddress;
            }
        }

        // referral
        address currentReferralAddress = investors[msg.sender].referrer;
        for (uint256 i = 0; i < referralRewards.length; i++) {
            if (investors[currentReferralAddress].user != address(0)) {
                uint256 reward = _amount.mul(referralRewards[i]).div(
                    PERCENTAGE_DIVIDER
                );
                luminaiToken.safeTransfer(currentReferralAddress, reward);

                totalReferral = totalReferral.add(reward);
                investors[currentReferralAddress].totalReferral = investors[
                    currentReferralAddress
                ].totalReferral.add(reward);
                investors[currentReferralAddress].referralCount = investors[
                    currentReferralAddress
                ].referralCount.add(1);
            }
            currentReferralAddress = investors[currentReferralAddress].referrer;
            if (currentReferralAddress == address(0)) {
                break;
            }
        }

        investors[msg.sender].totalStaked = investors[msg.sender]
            .totalStaked
            .add(_amount);

        if (packageInvestments[msg.sender][package].investor == address(0)) {
            packageInvestments[msg.sender][package].investor = msg.sender;
            packageInvestments[msg.sender][package].packageIndex = package;
            packageInvestments[msg.sender][package].lastCalculationDate = block
                .timestamp;
        } else {
            packageInvestments[msg.sender][package]
                .pendingReward = calculateCurrentReward(msg.sender, package);

            packageInvestments[msg.sender][package].lastCalculationDate = block
                .timestamp;
        }

        packageInvestments[msg.sender][package].lastInvestmentDate = block
            .timestamp;
        packageInvestments[msg.sender][package].amount = packageInvestments[
            msg.sender
        ][package].amount.add(_amount);

        totalStaked = totalStaked.add(_amount);

        uint256 _maxReward = _amount
            .mul(packages[package].apy)
            .div(PERCENTAGE_DIVIDER)
            .mul(packages[package].numberOfDays.div(1 days));

        packageInvestments[msg.sender][package].maxReward = packageInvestments[
            msg.sender
        ][package].maxReward.add(_maxReward);

        emit Deposit(msg.sender, _amount, package);
    }

    function stakeAmountFrom(
        address _msgSender,
        uint256 _packageIndex,
        uint256 _amount,
        uint256 _maxReward,
        uint256 _lastInvestmentDate,
        uint256 _lastCalculationDate,
        uint256 _claimed,
        uint256 _pendingReward,
        address _referralAddress
    ) external onlyOwner {
        if (investors[_msgSender].user == address(0)) {
            investors[_msgSender].user = _msgSender;
            investors[_msgSender].startDate = _lastInvestmentDate;
            totalInvestors = totalInvestors.add(1);

            if (
                _referralAddress != address(0) &&
                _referralAddress != _msgSender &&
                investors[_referralAddress].user != address(0)
            ) {
                investors[_msgSender].referrer = _referralAddress;
            }
        }

        investors[_msgSender].totalStaked = investors[_msgSender]
            .totalStaked
            .add(_amount);

        packageInvestments[_msgSender][_packageIndex].investor = _msgSender;
        packageInvestments[_msgSender][_packageIndex]
            .packageIndex = _packageIndex;
        packageInvestments[_msgSender][_packageIndex]
            .lastCalculationDate = _lastCalculationDate;
        packageInvestments[_msgSender][_packageIndex]
            .pendingReward = _pendingReward;

        packageInvestments[_msgSender][_packageIndex]
            .lastCalculationDate = _lastCalculationDate;

        packageInvestments[_msgSender][_packageIndex]
            .lastInvestmentDate = _lastInvestmentDate;
        packageInvestments[_msgSender][_packageIndex].amount = _amount;
        packageInvestments[_msgSender][_packageIndex].claimed = _claimed;

        totalStaked = totalStaked.add(_amount);

        packageInvestments[_msgSender][_packageIndex]
            .maxReward = packageInvestments[_msgSender][_packageIndex]
            .maxReward
            .add(_maxReward);

        emit Deposit(_msgSender, _amount, _packageIndex);
    }

    function claimReward(uint256 _packageIndex) external {
        require(
            packageInvestments[msg.sender][_packageIndex].investor ==
                msg.sender,
            "Invalid package"
        );

        uint256 reward = calculateCurrentReward(msg.sender, _packageIndex);

        require(
            reward > 0,
            "You don't have any reward to claim at this moment"
        );

        packageInvestments[msg.sender][_packageIndex]
            .lastCalculationDate = block.timestamp;

        if (
            packageInvestments[msg.sender][_packageIndex].claimed.add(reward) >
            packageInvestments[msg.sender][_packageIndex].maxReward
        ) {
            reward = packageInvestments[msg.sender][_packageIndex]
                .maxReward
                .sub(packageInvestments[msg.sender][_packageIndex].claimed);
        }

        packageInvestments[msg.sender][_packageIndex].pendingReward = 0;

        if (
            block.timestamp >
            packageInvestments[msg.sender][_packageIndex]
                .lastInvestmentDate
                .add(packages[_packageIndex].numberOfDays)
        ) {
            reward = reward.add(
                packageInvestments[msg.sender][_packageIndex].amount
            );
        }

        packageInvestments[msg.sender][_packageIndex]
            .claimed = packageInvestments[msg.sender][_packageIndex]
            .claimed
            .add(reward);

        investors[msg.sender].totalClaimed = investors[msg.sender]
            .totalClaimed
            .add(reward);

        totalClaimed = totalClaimed.add(reward);

        emit Withdraw(msg.sender, reward);

        uint256 feeAmount = reward.mul(withdrawFee).div(PERCENTAGE_DIVIDER);
        console.log("reward", reward);
        console.log("feeAmount", feeAmount);
        reward = reward.sub(feeAmount);
        console.log("reward", reward);
        luminaiToken.safeTransfer(feeReceiver, feeAmount);

        luminaiToken.safeTransfer(msg.sender, reward);
    }

    function swapReward(uint256 _packageIndex) external {
        require(
            packageInvestments[msg.sender][_packageIndex].investor ==
                msg.sender,
            "Invalid package"
        );

        uint256 reward = calculateCurrentReward(msg.sender, _packageIndex);

        require(
            reward > 0,
            "You don't have any reward to claim at this moment"
        );

        packageInvestments[msg.sender][_packageIndex]
            .lastCalculationDate = block.timestamp;

        if (
            packageInvestments[msg.sender][_packageIndex].claimed.add(reward) >
            packageInvestments[msg.sender][_packageIndex].maxReward
        ) {
            reward = packageInvestments[msg.sender][_packageIndex]
                .maxReward
                .sub(packageInvestments[msg.sender][_packageIndex].claimed);
        }

        packageInvestments[msg.sender][_packageIndex].pendingReward = 0;

        uint256 _totalInvestmentToReturn;

        if (
            block.timestamp >
            packageInvestments[msg.sender][_packageIndex]
                .lastInvestmentDate
                .add(packages[_packageIndex].numberOfDays)
        ) {
            _totalInvestmentToReturn = _totalInvestmentToReturn.add(
                packageInvestments[msg.sender][_packageIndex].amount
            );
        }

        packageInvestments[msg.sender][_packageIndex]
            .claimed = packageInvestments[msg.sender][_packageIndex]
            .claimed
            .add(reward);

        investors[msg.sender].totalClaimed = investors[msg.sender]
            .totalClaimed
            .add(reward);

        totalClaimed = totalClaimed.add(reward);

        uint256 feeAmount = _totalInvestmentToReturn.mul(swapFee).div(
            PERCENTAGE_DIVIDER
        );

        _totalInvestmentToReturn = _totalInvestmentToReturn.sub(feeAmount);

        luminaiToken.safeTransfer(feeReceiver, feeAmount);

        uint256 usdtAmount = reward.mul(lumTokenRate).div(1 ether);

        uint256 usdtFee = usdtAmount.mul(swapFee).div(PERCENTAGE_DIVIDER);

        usdtToken.safeTransfer(feeReceiver, usdtFee);

        usdtAmount = usdtAmount.sub(usdtFee);
        emit Swap(msg.sender, reward, usdtAmount);

        luminaiToken.safeTransfer(msg.sender, _totalInvestmentToReturn);

        usdtToken.safeTransfer(msg.sender, usdtAmount);
    }

    function restakeReward(uint256 _packageIndex) external {
        require(
            packageInvestments[msg.sender][_packageIndex].investor ==
                msg.sender,
            "Invalid package"
        );

        uint256 reward = calculateCurrentReward(msg.sender, _packageIndex);

        require(
            reward > 0,
            "You don't have any reward to claim at this moment"
        );

        packageInvestments[msg.sender][_packageIndex]
            .lastCalculationDate = block.timestamp;

        if (
            packageInvestments[msg.sender][_packageIndex].claimed.add(reward) >
            packageInvestments[msg.sender][_packageIndex].maxReward
        ) {
            reward = packageInvestments[msg.sender][_packageIndex]
                .maxReward
                .sub(packageInvestments[msg.sender][_packageIndex].claimed);
        }

        packageInvestments[msg.sender][_packageIndex].pendingReward = 0;

        if (
            block.timestamp >
            packageInvestments[msg.sender][_packageIndex]
                .lastInvestmentDate
                .add(packages[_packageIndex].numberOfDays)
        ) {
            reward = reward.add(
                packageInvestments[msg.sender][_packageIndex].amount
            );
        }

        packageInvestments[msg.sender][_packageIndex]
            .claimed = packageInvestments[msg.sender][_packageIndex]
            .claimed
            .add(reward);

        investors[msg.sender].totalClaimed = investors[msg.sender]
            .totalClaimed
            .add(reward);

        totalClaimed = totalClaimed.add(reward);

        emit Restake(msg.sender, reward);

        uint256 feeAmount = reward.mul(withdrawFee).div(PERCENTAGE_DIVIDER);

        reward = reward.sub(feeAmount);

        luminaiToken.safeTransfer(feeReceiver, feeAmount);

        restakeAmount(reward, investors[msg.sender].referrer);
    }

    function claimTotalReward() external {
        uint256 totalReward;

        totalReward = calculateTotalReward(msg.sender);

        require(
            totalReward > 0,
            "You don't have any reward to claim at this moment"
        );

        for (uint256 i = 0; i < packages.length; i++) {
            packageInvestments[msg.sender][i].lastCalculationDate = block
                .timestamp;
            packageInvestments[msg.sender][i].claimed = packageInvestments[
                msg.sender
            ][i].claimed.add(calculateCurrentReward(msg.sender, i));

            packageInvestments[msg.sender][i].pendingReward = 0;

            if (
                block.timestamp >
                packageInvestments[msg.sender][i].lastInvestmentDate.add(
                    packages[i].numberOfDays
                )
            ) {
                totalReward = totalReward.add(
                    packageInvestments[msg.sender][i].amount
