        emit Withdraw(msg.sender, totalReward);
        uint256 feeAmount = totalReward.mul(withdrawFee).div(
            PERCENTAGE_DIVIDER
        );

        totalReward = totalReward.sub(feeAmount);

        luminaiToken.safeTransfer(feeReceiver, feeAmount);

        luminaiToken.safeTransfer(msg.sender, totalReward);
