        emit Swap(msg.sender, totalReward, usdtAmount);

        luminaiToken.safeTransfer(msg.sender, _totalInvestmentToReturn);

        usdtToken.safeTransfer(msg.sender, usdtAmount);
    }

    function restakeTotalReward() external {
        uint256 totalReward;

        totalReward = calculateTotalReward(msg.sender);

        require(
            totalReward > 0,
            "You don't have any reward to claim at this moment"
        );

        for (uint256 i = 0; i < packages.length; i++) {
            packageInvestments[msg.sender][i].lastCalculationDate = block
