        );

        totalReward = totalReward.sub(feeAmount);

        luminaiToken.safeTransfer(feeReceiver, feeAmount);

        restakeAmount(totalReward, investors[msg.sender].referrer);
    }

    function withdrawTokens(uint256 _amount) external onlyOwner {
        require(
            usdtToken.balanceOf(address(this)) >= _amount,
            "Insufficient balance"
        );
        usdtToken.safeTransfer(msg.sender, _amount);
    }

